column2:
 hemoglobin (10.6g/dl)

next, if female:
female (?)

if female:
hemoglobin (10.6g/dl), female
no anemia

otherwise (if male or if female but hemoglobin less than 13g/dl):
mean corpuscular volume

next, based on mean corpuscular volume value:
if mean corpuscular volume is less than 80fl:
ferritin

if ferritin available:
ferritin (?)

if ferritin < 30ng/ml:
iron deficiency anemia

if ferritin > 100ng/ml:
anemia of chronic disease

if ferritin between 30ng/ml and 100ng/ml:
tibc

if tibc available:
tibc (?)

if tibc < 450mcg/dl:
anemia of chronic disease

if tibc > 450mcg/dl:
iron deficiency anemia

if mean corpuscular volume is greater than 100fl:
segmented neutrophils

if segmented neutrophils available:
segmented neutrophils (?)

if segmented neutrophils = 0:
unspecified anemia

if segmented neutrophils > 0:
vitamin b12/folate deficiency anemia

if mean corpuscular volume is between 80fl and 100fl:
reticulocyte count

if reticulocyte count available:
reticulocyte count (?)

if reticulocyte count <= 2%:
aplastic anemia

if reticulocyte count > 2%:
hemolytic anemia
